jm_check_fun_t check_model_map(const char *pname)
{
    return jm_search_propmap(pname, check_model_map_tab, 8);
}

static bool initialized = false;

const char *check_model_init(void)
{
    if (!initialized)
    {
        initialized = true;
        jm_version_string = JSON_MODEL_VERSION;
        // initialize sorted set _jm_cst_0
        _jm_cst_0[0] = (jm_constant_t) { cst_is_string, { .s = "null" } };
        _jm_cst_0[1] = (jm_constant_t) { cst_is_string, { .s = "boolean" } };
        _jm_cst_0[2] = (jm_constant_t) { cst_is_string, { .s = "integer" } };
        _jm_cst_0[3] = (jm_constant_t) { cst_is_string, { .s = "number" } };
        _jm_cst_0[4] = (jm_constant_t) { cst_is_string, { .s = "string" } };
        _jm_cst_0[5] = (jm_constant_t) { cst_is_string, { .s = "array" } };
        _jm_cst_0[6] = (jm_constant_t) { cst_is_string, { .s = "object" } };
        jm_sort_cst(_jm_cst_0, 7);
        check_model_map_tab[0] = (jm_propmap_t) { "", json_model_1 };
        check_model_map_tab[1] = (jm_propmap_t) { "URI-REFERENCE", json_model_2 };
        check_model_map_tab[2] = (jm_propmap_t) { "schemaArray", json_model_3 };
        check_model_map_tab[3] = (jm_propmap_t) { "simpleTypes", json_model_4 };
        check_model_map_tab[4] = (jm_propmap_t) { "typeArray", json_model_5 };
        check_model_map_tab[5] = (jm_propmap_t) { "stringArray", json_model_6 };
        check_model_map_tab[6] = (jm_propmap_t) { "ObjectSchema", json_model_7 };
        check_model_map_tab[7] = (jm_propmap_t) { "Schema", json_model_8 };
        jm_sort_propmap(check_model_map_tab, 8);
    }
    return NULL;
}

void check_model_free(void)
{
    if (initialized)
        initialized = false;

        // cleanup code
}

/*
 * # API
 *
 * ```c
 * bool error;
 * char *message;
 *
 * bool valid = check(json_value, "model-name", &error, &message);
 *
 * if (message)
 *    free(message), message = NULL;
 * ```
 *
 * - `error` is set of there was an error during initialization or if the model does not exists.
 * - `message` is provided if a non NULL pointer is passed, and must be freed by the caller.
 */
bool
check_model(const json_t *val, const char *name, bool *error, char **reasons)
{
    return jm_generic_entry(check_model_init, check_model_map, val, name, error, reasons);
}
